(834, 149, '_edit_last', '1'),
(835, 149, 'imagem_de_referencia', '150'),
(836, 149, '_imagem_de_referencia', 'field_6700e9ff44831'),
(837, 149, 'titulo', 'Como fazer uma receita de bolo'),
(838, 149, '_titulo', 'field_6700e9e844830'),
(839, 149, 'descricao', 'O processo de fazer um bolo envolve a combinação de ingredientes secos, como farinha e fermento, com ingredientes líquidos, como ovos, leite e óleo. Primeiro, os ingredientes secos são misturados, seguidos pelos líquidos, que são batidos até formar uma massa homogênea. Essa massa é despejada em uma forma untada e levada ao forno pré-aquecido. Após assar por cerca de 35 a 40 minutos, o bolo está pronto para ser retirado, resfriado e servido.\r\n\r\nAqui vai uma receita simples de bolo de baunilha! Seguindo as etapas direitinho, você terá um bolo macio e delicioso:'),
(840, 149, '_descricao', 'field_6700ea7444834'),
(841, 149, 'ingredientes', '2 xícaras de farinha de trigo\r\n1 e 1/2 xícaras de açúcar\r\n3 ovos\r\n1/2 xícara de óleo (pode usar manteiga derretida se preferir)\r\n1 xícara de leite\r\n1 colher de sopa de fermento em pó\r\n1 colher de chá de essência de baunilha (opcional)\r\n\r\nModo de preparo:\r\n\r\nPré-aqueça o forno: A 180°C (temperatura média).\r\nMisture os ingredientes secos: Em uma tigela, peneire a farinha de trigo e o fermento. Reserve.\r\nMisture os ingredientes líquidos: Em outra tigela, bata os ovos com o açúcar até formar uma mistura fofa e clara. Acrescente o óleo (ou manteiga derretida) e a essência de baunilha, misturando bem.\r\nAdicione o leite: Vá alternando o leite e a mistura de farinha aos poucos, mexendo delicadamente com uma espátula ou colher de pau, até formar uma massa homogênea.\r\nDespeje a massa na forma: Unte e enfarinhe uma forma de bolo (redonda ou retangular) e despeje a massa.\r\nAsse: Leve ao forno pré-aquecido por cerca de 35 a 40 minutos, ou até que, ao espetar um palito no centro do bolo, ele saia limpo.\r\nDeixe esfriar: Após retirar do forno, deixe o bolo esfriar por uns 10 minutos antes de desenformar.'),
(842, 149, '_ingredientes', 'field_6700ea2144832'),
(843, 149, 'tempo_de_preparo', '00:45:00'),
(844, 149, '_tempo_de_preparo', 'field_6700ea3644833'),
