(10, 1, '2024-10-04 21:52:39', '2024-10-05 00:52:39', '{\n    \"blogdescription\": {\n        \"value\": \"Descubra um mundo de receitas de bolos para todos os gostos e n\\u00edveis de habilidade. Desde bolos r\\u00e1pidos e f\\u00e1ceis para o dia a dia at\\u00e9 cria\\u00e7\\u00f5es mais elaboradas para ocasi\\u00f5es especiais. Explore ideias criativas e deliciosas, com instru\\u00e7\\u00f5es claras e dicas pr\\u00e1ticas para garantir um resultado perfeito em cada preparo. Aqui, todo bolo \\u00e9 uma oportunidade de ado\\u00e7ar momentos!\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2024-10-05 00:52:39\"\n    },\n    \"donovan::custom_logo\": {\n        \"value\": 9,\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2024-10-05 00:52:39\"\n    },\n    \"donovan::header_image\": {\n        \"value\": \"http://localhost/site/thecakes/wp-content/uploads/2024/10/imagem-de-cabecalho-1.png\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2024-10-05 00:52:39\"\n    },\n    \"donovan::header_image_data\": {\n        \"value\": {\n            \"url\": \"http://localhost/site/thecakes/wp-content/uploads/2024/10/imagem-de-cabecalho-1.png\",\n            \"thumbnail_url\": \"http://localhost/site/thecakes/wp-content/uploads/2024/10/imagem-de-cabecalho-1.png\",\n            \"timestamp\": 1728089557055,\n            \"attachment_id\": 8,\n            \"width\": 2560,\n            \"height\": 500\n        },\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2024-10-05 00:52:39\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', '1ed3ebe0-5085-48d1-b09f-77c71e78075e', '', '', '2024-10-04 21:52:39', '2024-10-05 00:52:39', '', 0, 'http://localhost/site/thecakes/2024/10/04/1ed3ebe0-5085-48d1-b09f-77c71e78075e/', 0, 'customize_changeset', '', 0),
