(12, 1, '2024-10-04 21:54:33', '2024-10-05 00:54:33', '{\n    \"donovan_theme_options[sidebar_position]\": {\n        \"value\": \"right-sidebar\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2024-10-05 00:54:23\"\n    },\n    \"donovan_theme_options[blog_title]\": {\n        \"value\": \"Mundo dos Bolos\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2024-10-05 00:54:23\"\n    },\n    \"donovan_theme_options[blog_description]\": {\n        \"value\": \"Um espa\\u00e7o doce onde voc\\u00ea encontra receitas de bolos para todas as ocasi\\u00f5es, desde os mais simples at\\u00e9 os mais elaborados. Com dicas, truques e inspira\\u00e7\\u00f5es para confeiteiros de todos os n\\u00edveis, venha descobrir como transformar ingredientes em momentos inesquec\\u00edveis!\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2024-10-05 00:54:33\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', 'b306f730-c2cc-46fd-a676-b86e33ec259a', '', '', '2024-10-04 21:54:33', '2024-10-05 00:54:33', '', 0, 'http://localhost/site/thecakes/?p=12', 0, 'customize_changeset', '', 0),
