(20, 1, '2024-10-05 00:55:44', '2024-10-05 03:55:44', '<!-- wp:paragraph -->\n<p>Bem-vindo ao nosso blog dedicado ao maravilhoso universo dos bolos! Aqui, nossa missão é reunir e compartilhar todas as receitas possíveis, desde os bolos mais simples e rápidos até os mais elaborados e imponentes. Quer você esteja em busca de um mini bolo fácil de fazer para o café da tarde ou queira se aventurar na criação de um bolo de festa grandioso, você está no lugar certo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>Com um carinho especial por cada receita, colecionamos instruções detalhadas para que confeiteiros de todos os níveis possam transformar ingredientes em momentos inesquecíveis. Junte-se a nós nessa jornada doce, onde cada bolo conta uma história e cada fatia é uma celebração!</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->', 'Sobre-nós', '', 'publish', 'closed', 'closed', '', 'sobre-nos', '', '', '2024-10-05 02:09:46', '2024-10-05 05:09:46', '', 0, 'http://localhost/site/thecakes/?page_id=20', 0, 'page', '', 0),
