(22, 1, '2024-10-05 00:56:31', '2024-10-05 03:56:31', '<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">1. Termos</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Ao acessar ao site&nbsp;<a href=\"http://localhost/site/thecakes/\">The Cakes</a>, concorda em cumprir estes termos de serviço, todas as leis e regulamentos aplicáveis ​​e concorda que é responsável pelo cumprimento de todas as leis locais aplicáveis. Se você não concordar com algum desses termos, está proibido de usar ou acessar este site. Os materiais contidos neste site são protegidos pelas leis de direitos autorais e marcas comerciais aplicáveis.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">2. Uso de Licença</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>É concedida permissão para baixar temporariamente uma cópia dos materiais (informações ou software) no site The Cakes, apenas para visualização transitória pessoal e não comercial. Esta é a concessão de uma licença, não uma transferência de título e, sob esta licença, você não pode:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol class=\"wp-block-list\"><!-- wp:list-item -->\n<li>modificar ou copiar os materiais;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>usar os materiais para qualquer finalidade comercial ou para exibição pública (comercial ou não comercial);</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>tentar descompilar ou fazer engenharia reversa de qualquer software contido no site The Cakes;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>remover quaisquer direitos autorais ou outras notações de propriedade dos materiais; ou</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>transferir os materiais para outra pessoa ou \'espelhe\' os materiais em qualquer outro servidor.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Esta licença será automaticamente rescindida se você violar alguma 