(50, 1, '2024-10-05 02:06:02', '2024-10-05 05:06:02', '<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">1. Termos</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Ao acessar ao site&nbsp;<a href=\"http://localhost/site/thecakes/\">The Cakes</a>, concorda em cumprir estes termos de serviço, todas as leis e regulamentos aplicáveis ​​e concorda que é responsável pelo cumprimento de todas as leis locais aplicáveis. Se você não concordar com algum desses termos, está proibido de usar ou acessar este site. Os materiais contidos neste site são protegidos pelas leis de direitos autorais e marcas comerciais aplicáveis.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">2. Uso de Licença</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>É concedida permissão para baixar temporariamente uma cópia dos materiais (informações ou software) no site The Cakes, apenas para visualização transitória pessoal e não comercial. Esta é a concessão de uma licença, não uma transferência de título e, sob esta licença, você não pode:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol class=\"wp-block-list\"><!-- wp:list-item -->\n<li>modificar ou copiar os materiais;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>usar os materiais para qualquer finalidade comercial ou para exibição pública (comercial ou não comercial);</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>tentar descompilar ou fazer engenharia reversa de qualquer software contido no site The Cakes;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>remover quaisquer direitos autorais ou outras notações de propriedade dos materiais; ou</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>transferir os materiais para outra pessoa ou \'espelhe\' os materiais em qualquer outro servidor.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Esta licença será automaticamente rescindida se você violar alguma dessas restrições e poderá ser rescindida por The Cakes a qualquer momento. Ao encerrar a visualização desses materiais ou após o término desta licença, você deve apagar todos os materiais baixados em sua posse, seja em formato eletrónico ou impresso.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">3. Isenção de responsabilidade</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol class=\"wp-block-list\"><!-- wp:list-item -->\n<li>Os materiais no site da The Cakes são fornecidos \'como estão\'. The Cakes não oferece garantias, expressas ou implícitas, e, por este meio, isenta e nega todas as outras garantias, incluindo, sem limitação, garantias implícitas ou condições de comercialização, adequação a um fim específico ou não violação de propriedade intelectual ou outra violação de direitos.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Além disso, o The Cakes não garante ou faz qualquer representação relativa à precisão, aos resultados prováveis ​​ou à confiabilidade do uso dos materiais em seu site ou de outra forma relacionado a esses materiais ou em sites vinculados a este site.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">4. Limitações</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Em nenhum caso o The Cakes ou seus fornecedores serão responsáveis ​​por quaisquer danos (incluindo, sem limitação, danos por perda de dados ou lucro ou devido a interrupção dos negócios) decorrentes do uso ou da incapacidade de usar os materiais em The Cakes, mesmo que The Cakes ou um representante autorizado da The Cakes tenha sido notificado oralmente ou por escrito da possibilidade de tais danos. Como algumas jurisdições não permitem limitações em garantias implícitas, ou limitações de responsabilidade por danos conseqüentes ou incidentais, essas limitações podem não se aplicar a você.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">5. Precisão dos materiais</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Os materiais exibidos no site da The Cakes podem incluir erros técnicos, tipográficos ou fotográficos. The Cakesnão garante que qualquer material em seu site seja preciso, completo ou atual. The Cakes pode fazer alterações nos materiais contidos em seu site a qualquer momento, sem aviso prévio. No entanto, The Cakes não se compromete a atualizar os materiais.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">6. Links</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>O The Cakes não analisou todos os sites vinculados ao seu site e não é responsável pelo conteúdo de nenhum site vinculado. A inclusão de qualquer link não implica endosso por The Cakes do site. O uso de qualquer site vinculado é por conta e risco do usuário.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Modificações</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>O The Cakes pode revisar estes termos de serviço do site a qualquer momento, sem aviso prévio. Ao usar este site, você concorda em ficar vinculado à versão atual desses termos de serviço.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Lei aplicável</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Estes termos e condições são regidos e interpretados de acordo com as leis do The Cakes e você se submete irrevogavelmente à jurisdição exclusiva dos tribunais naquele estado ou localidade.</p>\n<!-- /wp:paragraph -->', 'Termos de Uso', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2024-10-05 02:06:02', '2024-10-05 05:06:02', '', 22, 'http://localhost/site/thecakes/?p=50', 0, 'revision', '', 0),
(51, 1, '2024-10-05 02:09:43', '2024-10-05 05:09:43', '<!-- wp:paragraph -->\n<p>Bem-vindo ao nosso blog dedicado ao maravilhoso universo dos bolos! Aqui, nossa missão é reunir e compartilhar todas as receitas possíveis, desde os bolos mais simples e rápidos até os mais elaborados e imponentes. Quer você esteja em busca de um mini bolo fácil de fazer para o café da tarde ou queira se aventurar na criação de um bolo de festa grandioso, você está no lugar certo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>Com um carinho especial por cada receita, colecionamos instruções detalhadas para que confeiteiros de todos os níveis possam transformar ingredientes em momentos inesquecíveis. Junte-se a nós nessa jornada doce, onde cada bolo conta uma história e cada fatia é uma celebração!</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->', 'Sobre-nós', '', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2024-10-05 02:09:43', '2024-10-05 05:09:43', '', 20, 'http://localhost/site/thecakes/?p=51', 0, 'revision', '', 0),
