(2, 2, 'category', 'Bolos rápidos e práticos, perfeitos para quem quer algo saboroso sem complicações. Requerem poucos ingredientes e são ideais para iniciantes na cozinha.', 0, 8),
(3, 3, 'category', 'Bolos que exigem um pouco mais de técnica, como bater claras em neve ou preparar recheios. Perfeitos para quem já se aventura na cozinha e quer um desafio moderado.', 0, 6),
(4, 4, 'category', 'Bolos elaborados, com várias camadas, recheios complexos e decoração detalhada. Recomendado para quem tem experiência e gosta de criar verdadeiras obras de arte na confeitaria.', 0, 2),
(5, 5, 'category', 'Pequenas delícias feitas para satisfazer um desejo doce sem exagero. Esses bolinhos são rápidos de preparar, ideais para quem quer uma sobremesa personalizada, feita para uma só pessoa. Podem ser assados em forminhas individuais ou preparados no micro-ondas.', 0, 5),
